import {
	createBrowserRouter,
	Link,
	Route,
	RouterProvider,
	Routes,
	Outlet,
	BrowserRouter,
} from "react-router-dom";

import "./App.css";
import Header from "./components/Header";
import Navbar from "./components/Navbar";
import NotesListPage from "./pages/NotesListPage";
import NotePage from "./pages/NotePage";
import image1 from "../assets/images/child-learning-1.jpeg";
import image2 from "../assets/images/child-learning-1.jpeg";
import image3 from "../assets/images/child-learning-1.jpeg";

export default function App() {
	return (
		<BrowserRouter>
			<Routes>
				<Route element={<Layout />}>
					<Route path="/" element={<NotesListPage />} />
					<Route path="/note/:id" element={<NotePage />} />
				</Route>
			</Routes>
		</BrowserRouter>
	);
}

function Layout() {
	return (
	  <>
		<div className="navbar-container">
			<Navbar /> {/* This will place your Navbar at the top of the page */}
		</div>
		<div className="container">
			<div className="column1">
				<Header />
			</div>
			<div className="column2">
				<div className="header-images">
					<img src="../assets/images/child-learning-1.jpeg" alt="Child Learning" />
					<img src="../assets/images/child-learning-2.jpeg" alt="Child Learning" />
					<img src="/..assets/images/child-learning-3.jpeg" alt="Child Learning" />
				</div>
			</div>
		</div>
	  </>
	);
  }
